import React from 'react'



const Footer = () => {

    return(

        <div style={styles.footerContainer}>
            <footer className="mt-5 fixed-bottom">
                <div className="text-center py-3 bg-light">
                    <p>Hello footer</p>
                </div>
            </footer>
        </div>
    )
}

const styles = {
    footerContainer : {
        height: '1em'
    }
}

export default Footer;
